  [],\n\t\"revision_timestamp\": \"2015-05-06T21:06:56.272995\",\n\t\"name\": \"flight-adaptive-blade-for-optimum-rotor-response-fabforr-project-1333b\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"While past research has demonstrated the
  utility and benefits to be gained with the application of advanced rotor system
  control concepts, none have been implemented to date on a production military or
  commercial rotorcraft.  A key contributor to this fact is the inherent cost associated
  with installation and maintenance of these control systems, since many system designs
  require the replacement of a helicopter's rotor blades, rotor hub components, or
  both.  The proposed work addresses this deficiency through the development of an
  on-blade full-span camber control system that reaps many of the known benefits of
  advanced rotor control in a retrofit design approach that has the potential to achieve
  production status due to its lower risks and costs compared to previous system concepts.
  \ The design leverages past work in the use of smart-material actuated bistable
  tabs for rotor blade tracking, with a newer integral actuation concept that will
  lead toward a more robust and flightworthy design.\",\n\t\"license_title\": \"U.S.
